    false,nt"url": null,nt"notes": "This annual narrative report for Morris
    WMD outlines accomplishments during the 1985 calendar year. The report begins with
    a summary of the year's highlights and weather conditions. Land acquisition is covered.
    The report includes a planning section which discusses the master plan, compliance
    with environmental and cultural resource mandates, and research and investigations.
    Administration is outlined; information about personnel, youth programs, manpower
    programs, funding, safety, and technical assistance is given. Habitat management
    is also covered; subjects include wetlands, forests, croplands, grasslands, grazing,
    fire management, pest control, and WPA easements. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, and animal control. The public uses of
    the WMD described in this report include interpretive programs, hunting, fishing,
    trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, communication systems,
    computer systems, and energy conservation. Cooperative programs and items of interest
    are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
